import React, {Component} from 'react';

class Gallery extends Component{
  render() {   
  return (
        this.props.images.map(todo => ( 
          <div className='display-images' key={todo.id} onClick= {this.props.clickimage}>
              <img className='imginsert' key={todo.id} src={todo.Math.floor(Math.random()).title } alt='img' />
          </div>    
         ))

    );
  }
}

export default Gallery;
